    switch (index) {
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 250 ? 250 : value));
            let normalizedValue = (value - 0) / (250 - 0);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < 500 ? 500 : (value > 8000 ? 8000 : value));
            let normalizedValue = (value - 500) / (8000 - 500);
            return normalizedValue;
        }
    default:
        index -= 3;

        if (index < this.poly[0].getNumParameters()) {
            {
                return this.poly[0].convertToNormalizedParameterValue(index, value);
            }
        }

        return value;
    }
}

